import React from 'react';

import { fetchWeekForecast } from '../../utils/api';

import '../../styles/components/weather/_city-select.scss';

export default class WeeklyForecast extends React.Component {

	componentDidMount() {
		/** Grabs forecast for the week. **/
		fetchWeekForecast(this.props.city_id)
			.then((forecast) => {
				console.log('week', forecast);
			});
	}

	render() {
		return (
			<ul class="forecast-list">
				<li>
					<span class="forecast-time">MORN</span>
					<div class="forecast-info">
						<span class="temperature">5</span>
					</div>
				</li>
			</ul>
		)
	}
}
